answer = ifScript();

function ifScript() {
  gs.info("current.myos is: " + current.myos);
  gs.addInfoMessage("current.myos is: " + current.myos);
  //if(current.requested_for.title.toLowerCase().indexOf('vp') >= 0)
  if (current.myos.indexOf("Windows") >= 0) {
	gs.addInfoMessage("Returning YES YES YES");
	gs.info("Returning YES YES YES");
    return 'yes';
  }else {
	  gs.addInfoMessage("Returning NO NOPE NADA");
	  gs.info("Returning NO NOPE NADA");	  
	  return 'no';
  }
}

